import React from 'react';
import profileImage from '../assets/profile.jpg'; // Make sure the path matches the file name and extension

const Home = () => {
  return (
    <section id="home" className="home">
      <img src={profileImage} alt="Profile" style={{ width: '150px', borderRadius: '50%' }} />
      <h1>Ravi Kumar</h1>
      <h2>Full Stack Developer</h2>
    </section>
  );
};

export default Home;
